let animationIndex = 0;
let mixer = null;

function init() {
	if( this.animations.length > 0 && animationIndex < this.animations.length ) {
		mixer = new THREE.AnimationMixer( this );
		const animation = this.animations[animationIndex];
		const clipAction = mixer.clipAction( animation );
		clipAction.play();
	}
}

function update( event ) {
	if(mixer) {
		mixer.update( event.delta / 1000 );
	}
}
